                  }

                  .aboutMe {
                    position: relative;
                    margin-top: 30px;
                    margin-bottom: 30px;
                  }

                  .portrait {
                    background-image: url(../static/images/IMG_0709.jpg);
                    background-size: cover;
                    background-position: center center;
                    background-repeat: no-repeat;
                    border-radius: 50%;
                    height: 325px;
                    width: 75%;

                  }

                  .row {
                    padding: 50px;
                  }

                  .hello .col #js {
                    margin: 0;
                    margin-right: 0;
                    background-color: yellow;
                  }

                  .js {
                    background-color: yellow;
                  }
            `}</style>
        </Layout>
    );
  }
}

export default Home;
